import {Nav, Footer} from "./Components"
import { BrowserRouter as Router, Route } from "react-router-dom";


function App() {
  return (
      <Router>
        <Route path="/" element={<Nav />} />
        <Route path="/main" element={<Footer />} />
      </Router>
  );
}

export default App;
